import { Component } from "../../core/component";
import { SimpleEventDispatcher } from "strongly-typed-events";
import { SpriteItem } from "../../rendering/renderers/items/sprite_item";
import { GameObject } from "../../core/game_object";
import RendererComponent from "../../rendering/renderers/renderer_component";
import { CursorType } from "./cursor_type";
import { InteractionHandlerComponent } from "./interaction_handler_component";
import Input from "../Input";
import HitpointColliderComponent from "../../physics/collision/hitpoint_collider_component";
import { RenderMeshItem } from "../../rendering/renderers/items/render_mesh_item";
import MouseData from "../input_data_classes/mouse_data";
import MouseButton from "../input_enums/mouse_enum";
import TouchData from "../input_data_classes/touch_data";
import { IHitable } from "../../rendering/renderers/Interfaces/ihitable";
import { IHitableComponent, IMouseDown, IMouseUp, ITouchDown, ITouchUp } from "./interaction_interfaces";
import PixiHitBoxRenderer from "../../../../pixi/render_behaviors/pixi_hitbox_renderer";
import PixiSpriteRenderer from "../../../../pixi/render_behaviors/pixi_sprite_renderer";
import { Vector2 } from "../../../../utility/math_extended/vector2";



export class ButtonComponent extends Component implements IHitableComponent, IMouseDown, IMouseUp, ITouchDown, ITouchUp {
    protected _type = "ButtonComponent";
    public clickListener: SimpleEventDispatcher<void> = new SimpleEventDispatcher<void>();
    public hitboxRenderer?: PixiHitBoxRenderer;
    public currentHitboxRenderer!: IHitable;
    private _spriteRenderer: PixiSpriteRenderer;
    private _normalSprite: SpriteItem;
    private _hoverSprite: SpriteItem;
    private _heldSprite: SpriteItem;
    private _hovered:boolean = false;
    private _held:boolean = false;

    constructor(gameObject: GameObject, sprite: SpriteItem, hoverSprite: SpriteItem, heldSprite: SpriteItem){
        super(gameObject);

        this._normalSprite = sprite;
        this._hoverSprite = hoverSprite;
        this._heldSprite = heldSprite;

        this._spriteRenderer = new PixiSpriteRenderer().SetItem(sprite);
        this.gameObject.AddComponent(new RendererComponent(gameObject, this._spriteRenderer));
        this.SetComponentCursor(CursorType.POINTER);

        this.currentHitboxRenderer = this._spriteRenderer;
    }

    public Subscribe(interactionHandler: InteractionHandlerComponent): void {
        interactionHandler.BindMouseDown(this);
        interactionHandler.BindMouseUp(this);
        interactionHandler.BindTouchDown(this);
        interactionHandler.BindTouchUp(this);
    }

    public onMouseDown(event: MouseData): void {
        if(event.mouseButton == MouseButton.LEFTBUTTON){ //left click
            this.buttonDown(new Vector2(event.clientPosition.x, event.clientPosition.y));
        }
    }

    public onMouseUp(event: MouseData): void {
        if(this.currentHitboxRenderer.CheckHit(event.clientPosition.x, event.clientPosition.y)){
            if(this._held){
                this.Buttonclick();
            }
            this._held = false;
            this._spriteRenderer.SetItem(this._hoverSprite);
        }
    }

    public onTouchDown(event: TouchData){
        this.buttonDown(new Vector2(event.clientPosition.x, event.clientPosition.y));
    }

    public onTouchUp(event: TouchData){
        if(this.currentHitboxRenderer.CheckHit(event.clientPosition.x, event.clientPosition.y)){
            if(this._held){
                this.Buttonclick();
            }
        }
        this._held = false;
        this._spriteRenderer.SetItem(this._normalSprite);
    }

    private buttonDown(position: Vector2): void {
        if(this.currentHitboxRenderer.CheckHit(position.x, position.y)){
            this._held = true;
            this._spriteRenderer.SetItem(this._heldSprite);
        }
    }

    Update(){
        let mousePosition: Vector2 = Input.mouse.getMousePosition();
        if(this._hovered){
            if(!this.currentHitboxRenderer.CheckHit(mousePosition.x, mousePosition.y)){
                this._hovered = false;
                this._held = false;
                this._spriteRenderer.SetItem(this._normalSprite);
            }
        }
        else{
            if(!this._hovered && this.currentHitboxRenderer.CheckHit(mousePosition.x, mousePosition.y)){
                this._hovered = true;
                this._spriteRenderer.SetItem(this._hoverSprite);
            }
        }
    }

    public Buttonclick(): void{
        this.clickListener.dispatch();
    }

    public SetAnchor(anchorPoint: Vector2): void{
        this._normalSprite.pivot = anchorPoint;
        this._hoverSprite.pivot = anchorPoint;
        this._heldSprite.pivot = anchorPoint;
    }

    SetComponentCursor(cursor: CursorType): void{
        this._spriteRenderer.SetCursor(cursor);
    }

    /* TODO: fix shape offset support */
    SetHitArea(gameObject: GameObject): void {
        let hitbox = gameObject.GetComponent("HitpointColliderComponent") as HitpointColliderComponent;
        if(hitbox != null){
            let render = new RenderMeshItem(hitbox.mesh);
            this.hitboxRenderer = new PixiHitBoxRenderer(Array<RenderMeshItem>(render));
            this.hitboxRenderer.SetCursor(this._spriteRenderer.cursorType);
            this._spriteRenderer.SetCursor(CursorType.DEFAULT);
            gameObject.AddComponent(new RendererComponent(this.gameObject, this.hitboxRenderer));
            this.currentHitboxRenderer = this.hitboxRenderer;
        }
    }
}
